import React from 'react';
import Home from "./Home";
import Rooms from "./Rooms";
import SingleRooms from "./SingleRooms";
import Errors from "./Errors";
import "./App.css";

function App() {
  return (
    <div className="App">
      <p>welcome</p>
      <Home></Home>
      <Rooms></Rooms>
      <SingleRooms></SingleRooms>
      <Errors></Errors>

    </div>
  );
} 

export default App;
